/* Look through an expression for an assignment statement.  */

static void
gldavr32linux_find_exp_assignment (etree_type *exp)
{
  bfd_boolean provide = FALSE;

  switch (exp->type.node_class)
    {
    case etree_provide:
      provide = TRUE;
      /* Fall thru */
    case etree_assign:
      /* We call record_link_assignment even if the symbol is defined.
	 This is because if it is defined by a dynamic object, we
	 actually want to use the value defined by the linker script,
	 not the value from the dynamic object (because we are setting
	 symbols like etext).  If the symbol is defined by a regular
	 object, then, as it happens, calling record_link_assignment
	 will do no harm.  */
      if (strcmp (exp->assign.dst, ".") != 0)
	{
	  if (!bfd_elf_record_link_assignment (output_bfd, &link_info,
					       exp->assign.dst, provide,
					       exp->assign.hidden))
	    einfo ("%P%F: failed to record assignment to %s: %E\n",
		   exp->assign.dst);
	}
      gldavr32linux_find_exp_assignment (exp->assign.src);
      break;

    case etree_binary:
      gldavr32linux_find_exp_assignment (exp->binary.lhs);
      gldavr32linux_find_exp_assignment (exp->binary.rhs);
      break;

    case etree_trinary:
      gldavr32linux_find_exp_assignment (exp->trinary.cond);
      gldavr32linux_find_exp_assignment (exp->trinary.lhs);
      gldavr32linux_find_exp_assignment (exp->trinary.rhs);
      break;

    case etree_unary:
      gldavr32linux_find_exp_assignment (exp->unary.child);
      break;

    default:
      break;
    }
}


/* This is called by the before_allocation routine via
   lang_for_each_statement.  It locates any assignment statements, and
   tells the ELF backend about them, in case they are assignments to
   symbols which are referred to by dynamic objects.  */

static void
gldavr32linux_find_statement_assignment (lang_statement_union_type *s)
{
  if (s->header.type == lang_assignment_statement_enum)
    gldavr32linux_find_exp_assignment (s->assignment_statement.exp);
}

